import './Styles/App.css';
import RoutingSwitch from './BrowserRouter';


function App() {
  return (
  <div className='App-Container'>
    <header className='App-Header'>
      <div className='App-Header-Logo'>
        <a href='/'>Company Logo</a>
      </div>
      <ul className='App-Header-List'>
        <a href='/Shop'>Shop</a>
        <a href='#'>Cart</a>
      </ul>
    </header>
    <RoutingSwitch />
  </div>
  );
}

export default App;
